import "./App.css";
import Nav from "./Components/Nav";
import {BrowserRouter,Route,Routes} from "react-router-dom";
import Home from "./Components/"
function App() {
  return (
    <>
      <Nav />
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home/>} />
      </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
